INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 401, 24, 102301, 0.0, 10046, 24001, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", "アヤネ");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 402, 24, 102301, 0.0, 10046, 24002, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 2.21, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", "アヤネ");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 403, 24, 102301, 0.0, 10046, 24003, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", "アヤネ");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 701, 24, 192201, 0.0, 10046, 24004, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 1.99, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", "アサヒ");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 702, 24, 192201, 0.0, 10046, 24005, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 2.21, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", "アサヒ");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 703, 24, 192201, 0.0, 10046, 24006, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 3.33, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", "アサヒ");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 801, 24, 192301, 0.0, 10046, 24007, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", "部員３");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 802, 24, 192301, 0.0, 10046, 24008, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 2.68, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", "部員３");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 803, 24, 192301, 0.0, 10046, 24009, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", "部員３");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 501, 24, 192501, 0.0, 10046, 24010, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 0.0, "やった！", "");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 502, 24, 192501, 0.0, 10046, 24011, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 0.0, "勝ったよ！", "");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 503, 24, 192501, 0.0, 10046, 24012, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 0.0, "いい調子！", "");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 111, 24, 113501, 0.0, 10046, 24013, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 6, 5.33, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", "ミサト");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 112, 24, 113501, 0.0, 10046, 24014, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 6.85, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", "ミサト");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 113, 24, 113501, 0.0, 10046, 24015, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 3.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", "ミサト");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 611, 24, 192401, 0.0, 10046, 24016, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 6.11, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", "ダイチ");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 612, 24, 192401, 0.0, 10046, 24017, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 6.75, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", "ダイチ");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 613, 24, 192401, 0.0, 10046, 24018, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", "ダイチ");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 211, 24, 113401, 0.0, 10046, 24019, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 4.52, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", "ハツネ");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 212, 24, 113401, 0.0, 10046, 24020, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 3.89, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", "ハツネ");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 213, 24, 113401, 0.0, 10046, 24021, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 13.49, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", "ハツネ");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 311, 24, 106501, 0.0, 10046, 24022, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 3.17, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", "カヤ");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 312, 24, 106501, 0.0, 10046, 24023, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 4.42, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", "カヤ");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 313, 24, 106501, 0.0, 10046, 24024, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 6, 2.89, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", "カヤ");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 421, 24, 102301, 0.0, 10046, 24025, 3, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 4, 3.71, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", "アヤネ");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 721, 24, 192201, 0.0, 10046, 24026, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 5.1, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", "アサヒ");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 821, 24, 192301, 0.0, 10046, 24027, 3, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 4.34, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", "部員３");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 521, 24, 192501, 0.0, 10046, 24028, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 0.0, "いい勝負だったよ\nまたやろうね", "");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (-360.0, 101, 24, 113501, 0.0, 10046, 24029, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 5.62, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", "ミサト");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (-360.0, 102, 24, 113501, 0.0, 10046, 24030, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 9.58, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", "ミサト");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (-360.0, 103, 24, 113501, 0.0, 10046, 24031, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 0.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", "ミサト");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (-360.0, 104, 24, 113501, 0.0, 10046, 24032, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 9.13, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", "ミサト");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (-360.0, 105, 24, 113501, 0.0, 10046, 24033, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 8.27, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", "ミサト");
